import {
  BrowserRouter as Router,
  Route,
  Switch,

} from "react-router-dom";

import Home from "./routes/Home";
import Detail from "./routes/Detail";
function App() {
  return (<Router>
    <Switch>
      <Route path="/movie/:id">
        <Detail />
        </Route>
      <Route path={`${process.env.PUBLIC_URL}/`} element={Home}> 

        </Route>

      </Switch>
    </Router>
  );
}

export default App;
